import { useState } from "react";

// PC PARTS DATA
const GPUS = {
  "RTX 4090": { name: "RTX 4090", fps: 1.0 },
  "RTX 4080": { name: "RTX 4080", fps: 0.85 },
  "RX 7900 XTX": { name: "RX 7900 XTX", fps: 0.83 },
};

const CPUS = {
  "RYZEN 9": { name: "RYZEN 9", fps: 1.0 },
  "RYZEN 7": { name: "RYZEN 7", fps: 0.85 },
  "RYZEN 5": { name: "RYZEN 5", fps: 0.7 },
};

const RAMS = {
  "16GB DDR5": { name: "16GB DDR5", fps: 0.95 },
  "32GB DDR5": { name: "32GB DDR5", fps: 1.0 },
  "64GB DDR5": { name: "64GB DDR5", fps: 1.02 },
};

const MOBOS = {
  "B650": { name: "B650", fps: 1.0 },
  "B870": { name: "B870", fps: 1.0 },
  "X870E": { name: "X870E", fps: 1.0 },
};

function App() {
  const [selectedGPU, setSelectedGPU] = useState(null);
  const [selectedCPU, setSelectedCPU] = useState(null);
  const [selectedMOBO, setSelectedMOBO] = useState(null);
  const [selectedRAM, setSelectedRAM] = useState(null);

  const estimatedFPS =
    selectedGPU && selectedCPU && selectedRAM
      ? Math.round(200 * selectedGPU.fps * selectedCPU.fps * selectedRAM.fps)
      : null;

  return (
    <div style={{
      minHeight: "100vh",
      background: "linear-gradient(135deg, #1a1a1a 0%, #2d2d2d 100%)",
      padding: "60px 20px",
      fontFamily: "'Inter', -apple-system, BlinkMacSystemFont, sans-serif"
    }}>
      <div style={{
        maxWidth: "600px",
        margin: "0 auto"
      }}>
        {/* Header */}
        <div style={{ 
          textAlign: "center", 
          marginBottom: "50px",
          borderBottom: "1px solid #404040",
          paddingBottom: "30px"
        }}>
          <h1 style={{
            fontSize: "42px",
            fontWeight: "700",
            color: "#ffffff",
            margin: "0 0 10px 0",
            letterSpacing: "-1px"
          }}>
            PC Builder
          </h1>
          <p style={{
            color: "#888888",
            fontSize: "16px",
            margin: "0"
          }}>
            Configure your dream gaming rig
          </p>
        </div>

        {/* GPU */}
        <div style={{
          background: "#232323",
          border: "1px solid #333333",
          borderRadius: "12px",
          padding: "24px",
          marginBottom: "16px",
          transition: "all 0.3s ease"
        }}>
          <label style={{
            display: "block",
            color: "#ffffff",
            fontSize: "14px",
            fontWeight: "600",
            marginBottom: "12px",
            textTransform: "uppercase",
            letterSpacing: "1px"
          }}>
            Graphics Card
          </label>
          <select
            style={{
              width: "100%",
              padding: "14px 16px",
              fontSize: "16px",
              borderRadius: "8px",
              border: "1px solid #404040",
              background: "#1a1a1a",
              color: "#ffffff",
              cursor: "pointer",
              outline: "none",
              transition: "all 0.2s ease"
            }}
            value={selectedGPU?.name || ""}
            onChange={(e) => setSelectedGPU(GPUS[e.target.value] || null)}
          >
            <option value="">Select GPU</option>
            {Object.keys(GPUS).map((gpu) => (
              <option key={gpu} value={gpu}>
                {gpu}
              </option>
            ))}
          </select>
          {selectedGPU && (
            <p style={{ 
              color: "#888888", 
              fontSize: "14px", 
              margin: "12px 0 0 0" 
            }}>
              Selected: <span style={{ color: "#ffffff" }}>{selectedGPU.name}</span>
            </p>
          )}
        </div>

        {/* CPU */}
        <div style={{
          background: "#232323",
          border: "1px solid #333333",
          borderRadius: "12px",
          padding: "24px",
          marginBottom: "16px"
        }}>
          <label style={{
            display: "block",
            color: "#ffffff",
            fontSize: "14px",
            fontWeight: "600",
            marginBottom: "12px",
            textTransform: "uppercase",
            letterSpacing: "1px"
          }}>
            Processor
          </label>
          <select
            style={{
              width: "100%",
              padding: "14px 16px",
              fontSize: "16px",
              borderRadius: "8px",
              border: "1px solid #404040",
              background: "#1a1a1a",
              color: "#ffffff",
              cursor: "pointer",
              outline: "none"
            }}
            value={selectedCPU?.name || ""}
            onChange={(e) => setSelectedCPU(CPUS[e.target.value] || null)}
          >
            <option value="">Select CPU</option>
            {Object.keys(CPUS).map((cpu) => (
              <option key={cpu} value={cpu}>
                {cpu}
              </option>
            ))}
          </select>
          {selectedCPU && (
            <p style={{ 
              color: "#888888", 
              fontSize: "14px", 
              margin: "12px 0 0 0" 
            }}>
              Selected: <span style={{ color: "#ffffff" }}>{selectedCPU.name}</span>
            </p>
          )}
        </div>

        {/* Motherboard */}
        <div style={{
          background: "#232323",
          border: "1px solid #333333",
          borderRadius: "12px",
          padding: "24px",
          marginBottom: "16px"
        }}>
          <label style={{
            display: "block",
            color: "#ffffff",
            fontSize: "14px",
            fontWeight: "600",
            marginBottom: "12px",
            textTransform: "uppercase",
            letterSpacing: "1px"
          }}>
            Motherboard
          </label>
          <select
            style={{
              width: "100%",
              padding: "14px 16px",
              fontSize: "16px",
              borderRadius: "8px",
              border: "1px solid #404040",
              background: "#1a1a1a",
              color: "#ffffff",
              cursor: "pointer",
              outline: "none"
            }}
            value={selectedMOBO?.name || ""}
            onChange={(e) => setSelectedMOBO(MOBOS[e.target.value] || null)}
          >
            <option value="">Select Motherboard</option>
            {Object.keys(MOBOS).map((mobo) => (
              <option key={mobo} value={mobo}>
                {mobo}
              </option>
            ))}
          </select>
          {selectedMOBO && (
            <p style={{ 
              color: "#888888", 
              fontSize: "14px", 
              margin: "12px 0 0 0" 
            }}>
              Selected: <span style={{ color: "#ffffff" }}>{selectedMOBO.name}</span>
            </p>
          )}
        </div>

        {/* RAM */}
        <div style={{
          background: "#232323",
          border: "1px solid #333333",
          borderRadius: "12px",
          padding: "24px",
          marginBottom: "16px"
        }}>
          <label style={{
            display: "block",
            color: "#ffffff",
            fontSize: "14px",
            fontWeight: "600",
            marginBottom: "12px",
            textTransform: "uppercase",
            letterSpacing: "1px"
          }}>
            Memory
          </label>
          <select
            style={{
              width: "100%",
              padding: "14px 16px",
              fontSize: "16px",
              borderRadius: "8px",
              border: "1px solid #404040",
              background: "#1a1a1a",
              color: "#ffffff",
              cursor: "pointer",
              outline: "none"
            }}
            value={selectedRAM?.name || ""}
            onChange={(e) => setSelectedRAM(RAMS[e.target.value] || null)}
          >
            <option value="">Select RAM</option>
            {Object.keys(RAMS).map((ram) => (
              <option key={ram} value={ram}>
                {ram}
              </option>
            ))}
          </select>
          {selectedRAM && (
            <p style={{ 
              color: "#888888", 
              fontSize: "14px", 
              margin: "12px 0 0 0" 
            }}>
              Selected: <span style={{ color: "#ffffff" }}>{selectedRAM.name}</span>
            </p>
          )}
        </div>

        {/* Estimated FPS */}
        {estimatedFPS && (
          <div style={{
            background: "linear-gradient(135deg, #2d2d2d 0%, #1a1a1a 100%)",
            border: "2px solid #404040",
            borderRadius: "16px",
            padding: "32px",
            textAlign: "center",
            marginTop: "30px"
          }}>
            <p style={{
              color: "#888888",
              fontSize: "12px",
              fontWeight: "600",
              textTransform: "uppercase",
              letterSpacing: "2px",
              margin: "0 0 12px 0"
            }}>
              Estimated Performance
            </p>
            <p style={{
              fontSize: "56px",
              fontWeight: "700",
              color: "#ffffff",
